-- use master
-- create database GelreAirport
-- GO

use GelreAirport

-- Create tables
create table Gate
(
  gatecode char(1) not null,
  constraint pk_gate primary key (gatecode)
)

create table Luchthaven
(
  luchthavencode char(3)     not null,
  naam           varchar(25) not null,
  land           varchar(30)         , 
  constraint pk_luchthaven primary key (luchthavencode),
  constraint ak_luchthaven unique (naam)
)

create table Maatschappij
(
  maatschappijcode char(2)     not null,
  naam             varchar(25) not null,
  max_objecten_pp  numeric(2)  not null,
  constraint pk_maatschappij primary key (maatschappijcode),
  constraint ak_maatschappij unique (naam)
)

create table Vlucht
(
  vluchtnummer      numeric(5)   not null,
  bestemming        char(3)      not null,
  gatecode          char(1)              ,
  max_aantal        numeric(3)   not null, 
  max_gewicht_pp    numeric(6,2) not null,
  max_totaalgewicht numeric(6,2) not null,
  vertrektijd       datetime             ,
  maatschappijcode  char(2)      not null, 
  constraint pk_vlucht primary key (vluchtnummer)
)

create table Balie
(
  balienummer numeric(2) not null,
  wachtwoord varchar(200) not null,
  constraint pk_balie primary key (balienummer)
)

create table Passagier
(
  passagiernummer numeric(6)   not null,
  naam            varchar(35)  not null,
  vluchtnummer    numeric(5)   not null,
  geslacht        char(1)              ,
  balienummer     numeric(2)           ,
  stoel           char(3)              ,
  inchecktijdstip datetime             , 
  wachtwoord      varchar(200) not null,
  constraint pk_passagier primary key (passagiernummer),
  constraint ak_passagier unique(vluchtnummer, stoel)
)

create table IncheckenBestemming
(
  luchthavencode char(3)    not null,
  balienummer    numeric(2) not null,
  constraint pk_incheckenbestemming primary key (luchthavencode, balienummer)
)

create table IncheckenVlucht
(
  vluchtnummer numeric(5) not null,
  balienummer  numeric(2) not null,
  constraint pk_incheckenvlucht primary key (vluchtnummer, balienummer)
)

create table IncheckenMaatschappij
(
  maatschappijcode char(2)    not null,
  balienummer      numeric(2) not null,
  constraint pk_incheckenmaatschappij primary key (maatschappijcode, balienummer)
)

create table BagageObject
(
  passagiernummer  numeric(6)   not null,
  objectvolgnummer numeric(1)   not null,
  gewicht          numeric(6,2) not null,
  constraint pk_bagageobject primary key (passagiernummer, objectvolgnummer)
)

go 

-- Foreign keys
alter table Vlucht
  add constraint fk_vlucht_luchthaven foreign key (bestemming)
    references Luchthaven(luchthavencode)
      on update cascade

alter table Vlucht
  add constraint fk_vlucht_gate foreign key (gatecode)
    references Gate (gatecode)
      on update cascade

alter table Vlucht
  add constraint fk_vlucht_maatschappij foreign key (maatschappijcode)
    references Maatschappij (maatschappijcode)
      on update cascade

alter table Passagier
  add constraint fk_passagier_vlucht foreign key (vluchtnummer)
    references Vlucht (vluchtnummer)
      on update cascade

alter table Passagier
  add constraint fk_passagier_balie foreign key (balienummer)
    references Balie (balienummer)
      on update cascade

alter table IncheckenBestemming
  add constraint fk_incheckenbestemming_balie foreign key (balienummer)
    references Balie (balienummer)
      on update cascade

alter table IncheckenBestemming 
  add constraint fk_incheckenbestemming_luchthaven foreign key (luchthavencode)
    references Luchthaven (luchthavencode)
      on update cascade

alter table IncheckenVlucht
  add constraint fk_incheckenvlucht_vlucht foreign key (vluchtnummer)
    references Vlucht (vluchtnummer)
      on update cascade

alter table IncheckenVlucht
  add constraint fk_incheckenvlucht_balie foreign key (balienummer)
    references Balie (balienummer)
      on update cascade

alter table IncheckenMaatschappij
  add constraint fk_incheckenmaatschappij_maatschappij foreign key (maatschappijcode)
    references Maatschappij (maatschappijcode)
      on update cascade

alter table IncheckenMaatschappij
  add constraint fk_incheckenmaatschappij_balie foreign key (balienummer)
    references Balie (balienummer)
      on update cascade

alter table BagageObject
  add constraint fk_bagageobject_passagier foreign key (passagiernummer)
    references Passagier (passagiernummer)
      on update cascade
      on delete cascade

go

